Some gamebooks or gamebook-related books are so fiendishly difficult that they are often put back on the shelf and never completed. This was the case with many of the Fantasy Questbooks that I owned. Over the past year I have made a concerted effort to complete as many of these as possible, and PDF the solutions so I won't forget in future. Since these are so difficult, I thought I'd share them with other gamebook fans. 

Maps in PDF format.
